Domenica 17 settembre 2017, alle ore 21.00, presso l’anfiteatro del Parco Archeologico di Monte Sirai, a Carbonia, verrà ospitato “Genti, intendete questo sermone” (monologhi giullareschi medioevali e moderni), di e con Matteo Belli, organizzato dall'associazione Il Crogiuolo in collaborazione con la Cooperativa Mediterranea.

Il costo del biglietto di ingresso è di 8,00 Euro;

Per l'occasione, alle ore 18.00, sarà possibile usufruire della visita guidata del Parco di Monte Sirai con biglietto ridotto. In tal caso, il costo del biglietto d'ingresso per lo spettacolo sarà di soli 3,00 Euro, esibendo il ticket della visita.
